import {FormChild} from "../childcomponents/FormChild";

export const SignupComponent = () => {
    const signup = (firstname,lastname,email,password,birthdate,phone_number) => {
        console.log(firstname,lastname,email,password,birthdate,phone_number)
    }
    const parameters={
        title:"Inscription",
        subtitle:"Créez votre compte",
        signinUrl:"/signin",
        event: signup,
        button:{
            value:"S'inscrire"
        }
    }
    const inputs = [
        {
            label:"Prénom",
            type:"text",
            placeholder:"Entrez votre prénom",
            name:"firstname",
            className:"form-control myform"
        },
        {
            label:"Nom",
            type:"text",
            placeholder:"Entrez votre nom",
            name:"lastname",
            className:"form-control myform"
        },
        {
            label:"Email",
            type:"email",
            placeholder:"abc@gmail.com",
            name:"email",
            className:"form-control myform"
        },
        {
            label:"Mot de passe",
            type:"password",
            placeholder:"Entrez votre mot de passe",
            name:"password",
            className:"form-control myform"
        },
        {
            label:"Date de naissance",
            type:"date",
            placeholder:"Entrez votre date de naissance",
            name:"birthdate",
            className:"form-control myform"
        },
        {
            label:"Numéro de téléphone",
            type:"tel",
            placeholder:"0xxxxxxxxx",
            name:"phone_number",
            className:"form-control myform",
        }
        ]
    return (
        <FormChild parameters={parameters} inputs={inputs}/>
    )
}
